package Basic;

public class Unaryoperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int i=10;
i++;
System.out.println("post increment ="+i);
++i;
System.out.println("pre increment ="+i);
i--;
System.out.println("post decrement ="+i);
i=12;
--i;
System.out.println("pre increment ="+i);

	}

}
